// Function for trading Seedbonus points
const localJS = `
function tradeNow(key) {
	$.ajax({
		url: siteUrl + "seedbonus.php",
		type: "POST",
		data: {
			module: "trade",
			trade_id: key
		},
		success: ""
	});
}`;

// Store localJS in DOM
(function addScript() {
    let script = document.createElement("script");
    script.setAttribute("type","text/javascript");
    script.innerHTML = localJS;
    document.body.appendChild(script);
})();

try {
// Update heading
shead.children[5].innerHTML = "Trade for Credits";

// Update redeem buttons
for (let x = 0; x < sbody.length; x++) {
    let redeemCell = sbody[x].children[5],
        num = sbody[x].children[1].innerHTML.replace(" Times", ""),
        cost = sbody[x].children[0].innerHTML,
        upOne = sbody[x].children[2].innerHTML.replace(/<span.*/,""),
        upAll = sbody[x].children[2].innerHTML.replace(/.*span>/,"");

    redeemCell.innerHTML = redeemCell.innerHTML.replace(/>\s+</g,"><").replace(/\s*\n\s*/g,"");
    let one = redeemCell.innerHTML.replace(/Redeem/,"One").replace(/("\sclass=")/,"$1redeem-one ").replace(/\stype..submit./,"").replace(/\smethod..post./,"").replace(/\saction..seedbonus.php./,"").replace(/<input.*(<button)/,"$1").replace(/(<form)/,"$1 onsubmit=\"return false;\""),
        all = redeemCell.innerHTML.replace(/Redeem/,"All").replace(/Trade.*points/,"Trade all points").replace(/\stype..submit./,"").replace(/\saction.*php"/,"").replace(/\smethod.*post"/,"").replace(/<input.*(<button)/,"$1").replace(/(form\sclass=")/,"$1redeem-all ").replace(/(<form)/,"$1 onsubmit=\"return false;\"");

    if (broke() || num == 0 || num == 1) {all = "";} else {
        redeemCell.setAttribute("style","display: flex;gap: 1em;");
    }

    redeemCell.innerHTML = one + all;

    redeemCell.getElementsByTagName("button")[0].setAttribute("time","1");
    redeemCell.getElementsByTagName("button")[0].setAttribute("point",cost);
    redeemCell.getElementsByTagName("button")[0].setAttribute("credit",upOne);
    redeemCell.getElementsByTagName("button")[0].setAttribute("growth",upOne);
    redeemCell.getElementsByTagName("button")[0].setAttribute("gcost",cost);

    try {
        redeemCell.getElementsByTagName("button")[1].setAttribute("time",num);
        redeemCell.getElementsByTagName("button")[1].setAttribute("point",(parseFloat(cost)*parseFloat(num)).toString());
        redeemCell.getElementsByTagName("button")[1].setAttribute("credit",upAll);
        redeemCell.getElementsByTagName("button")[1].setAttribute("growth",upOne);
        redeemCell.getElementsByTagName("button")[1].setAttribute("gcost",cost);
    } catch(e) {}
}

// Add redeem dialogue and warning
function rDial(credit,point,time,value,growth,gcost) {
    let shell, dialogue = `
      <div class="swal-modal" role="dialog" aria-modal="true">
        <div class="swal-text">Do you want to redeem <b>${credit}</b> Upload Credits using <b>${point}</b> Seedbonus points?
          <br><br><b class="red-text">You cannot undo this, even with support tickets.</b>
          <br><br>By clicking "Proceed", you hereby agree that you are using this tool of your own volition, and that no one but you may be held responsible for any unexpected results.
        </div>
        <div class="swal-footer">
          <div class="swal-button-container">
            <button class="redeem-cancel swal-button swal-button--cancel">Cancel</button>
          </div>
          <div class="swal-button-container">
            <button time="${time}" gcost="${gcost}" growth="${growth}" point="${point}" credit="${credit}" value="${value}" class="redeem-proceed swal-button swal-button--confirm">Proceed</button>
          </div>
        </div>
      </div>
    `;

    shell = document.createElement("div");
    shell.classList.add("redeem-dialogue","swal-overlay","swal-overlay--show-modal");
    shell.setAttribute("tabindex","-1");
    shell.innerHTML = dialogue;
    document.body.appendChild(shell);
}

// Redeem one or all
function rRedeem(key) {
    rDial(key.getAttribute("credit"),key.getAttribute("point"),key.getAttribute("time"),key.getAttribute("value"),key.getAttribute("growth"),key.getAttribute("gcost"));
}

// Redeem Cancel
function rCancel() {
    let dial = document.getElementsByClassName("redeem-dialogue")[0];
    dial.classList.remove("swal-overlay--show-modal");
    setTimeout(function() {
        dial.remove();
    }, 100);
}

// Redeem Proceed
function rProceed(key) {
    let redial = document.getElementsByClassName("redeem-dialogue")[0],
        retext = redial.getElementsByClassName("swal-text")[0],
        refoot = redial.getElementsByClassName("swal-footer")[0];

    refoot.remove();

    function reinfo(credit,point,count,fullcount) {
        retext.innerHTML = `
          You have received <b>${credit}</b> Upload Credits for <b>${point}</b> Seedbonus points.
          <br><br>Pass <b>${count}</b> of <b>${fullcount}</b>.
        `;
        if (count == fullcount) {
            retext.innerHTML = retext.innerHTML + `
              <br><br>Success!
            `;
        }
    }

    for (let x = 0; x < parseInt(key.getAttribute("time")); x++) {
        let wait = x*100,
            now = x+1;

        location.assign("javascript:tradeNow(" + key.getAttribute("value") + ")");

        setTimeout(function() {
            reinfo(creditGet(byteGet(key.getAttribute("growth"))*now),(parseFloat(key.getAttribute("gcost"))*now).toString(),now.toString(),key.getAttribute("time"));
        }, wait);

        if (now == key.getAttribute("time")) {
            setTimeout(function() {
                window.location.reload();
            }, 1000);
        }
    }
}

// Event listener for redeem buttons
document.addEventListener("click", function(event) {
    if (event.target.parentNode.className.match(/redeem\-one/) || (event.target.parentNode.className.match(/redeem\-all/))) {
        rRedeem(event.target);
    }
    if (event.target.className.match(/redeem\-cancel/)) {
        rCancel();
    }
    if (event.target.className.match(/redeem\-proceed/)) {
        rProceed(event.target);
    }
});
} catch(e) {}